public static boolean isInt(String str) {
    boolean isInt;
    if (str == null) {
        isInt = false;
    }
    else {
        try {
            Integer.parseInt(str);
            isInt = true;
        }
        catch (NumberFormatException ignored) {
            isInt = false;
        }
    }
    return isInt;
}

